def main():
    inp = ""
    offset = int(inp[:7])
    inp = [int(x) for x in inp * 10000][offset:]

    new = [0] * len(inp)
    for _ in range(100):
        print(_)
        new[0] = sum(abs(x) for x in inp)
        for x in range(1, len(inp)):
            new[x] = new[x - 1] - inp[x - 1]
        inp = [x % 10 for x in new]

    print("".join(str(x) for x in inp[:8]))

main()
